import Sachin16 from './Sachin16';
import { useState } from 'react';

import logo from './logo.svg';
import './App.css';

function App() {

  const [data]=useState("rakhi")
  const [data1]=useState("545445454545")
  function change(){
    data="sachin"
    data1="45454634354"
  }

  return (
    <div>

    <Sachin16 name={data} Number={data1}></Sachin16>
    <button onClick={change}>OK</button>

    </div>
  );
}

export default App;
